import React from 'react'
const Index = (props) => {
	const { room, nums, handleExitRoom } = props
	return (
		<div class='status-room'>
			<div class='room-name'>
				<p>Room: {room}</p>
			</div>
			<div
				class='button-close'
				onClick={(e) => {
					e.preventDefault()
					handleExitRoom()
				}}
			>
				<i class='fas fa-times-circle close-btn'></i>
			</div>
		</div>
	)
}

export default Index
